import { Component, OnInit } from '@angular/core';
import { AngularFirestore } from '@angular/fire/compat/firestore';
import { AddUser, app } from  'src/firebaseConfig';
import { ToastController } from '@ionic/angular';





@Component({
  selector: 'app-signup',
  templateUrl: './signup.page.html',
  styleUrls: ['./signup.page.scss'],
})

export class SignupPage implements OnInit {


  familyName = "";
  name = "";
  email = "";
  password = "";
  date = "";
  sexe = "";
  userrole = "patient";
  constructor(private firestore: AngularFirestore, private toastController: ToastController) { }

  ngOnInit() {
  }

  async presentToast(message: string) {
    const toast = await this.toastController.create({
      message: message,
      duration: 3000,
      position: 'bottom',
    });
    toast.present();
  }

  async AddUser() {

try{
    // Utilisez la fonction AddUser du fichier firebaseConfig avec les paramètres du formulaire
    await AddUser(this.firestore,app ,this.familyName, this.name, this.email, this.password, this.date, this.sexe ,this.userrole);
    this.presentToast('Registration successful!');
    // Réinitialisez les valeurs du formulaire après l'ajout réussi
    this.familyName = '';
    this.name = '';
    this.email = '';
    this.password = '';
    this.date = '';
    this.sexe = '';
  }
  catch(error){
    console.log('Error during registration:', error);
  }

  }


}





<ion-header [translucent]="true">
  <ion-toolbar>
    <ion-button slot="start">
      <ion-back-button text="Retour" routerLink="/home">
      </ion-back-button>
    </ion-button>
    <ion-title>Inscription</ion-title>
  </ion-toolbar>
</ion-header>

<ion-content>
  <ion-grid>
    <ion-row class="justify-content-center">
     <ion-col>
      <div class="ion-text-center">
        <br><br><br><br>
        <h4>Register Form</h4>
      </div><br><br><br><br>
      <div class="form">
        <form>
        <ion-item>
          <ion-input [(ngModel)]="familyName" placeholder="Enter your family name" type="text"  name="familyName" [ngModelOptions]="{standalone: true}">
            <ion-icon name="person-outline"></ion-icon>
          </ion-input>
        </ion-item><br>
        <ion-item>
          <ion-input [(ngModel)]="name" placeholder="Enter your name" type="text"  name="name">
            <ion-icon name="person-outline"></ion-icon>
          </ion-input>
        </ion-item><br>
        <ion-item>
          <ion-input [(ngModel)]="email" placeholder="Enter email" type="email"  name="email">
            <ion-icon name="mail-outline"></ion-icon>
          </ion-input>
        </ion-item>
        <br>
        <ion-item>
        <ion-input [(ngModel)]="password" placeholder="Enter password" type="password" spellcheck="false" name="password">
          <ion-icon name="lock-closed-outline"></ion-icon></ion-input>
        </ion-item>
        <br>
        <ion-item>
          <ion-input [(ngModel)]="date" placeholder="Enter date" type="date"  name="date">
            </ion-input>
          </ion-item>
          <br>
        </form>
      </div>
      <label>
        <input type="radio" [(ngModel)]="sexe"  name="sexe" value="Masculin"> Masculin
      </label>
      <label>
        <input type="radio" [(ngModel)]="sexe"  name="sexe" value="Féminin"> Féminin
      </label>
      <br>
      <div padding>
        <br><br><br><br>

        <ion-button size="large" expand="block" (click)="AddUser()" >Register</ion-button>
      </div>
     </ion-col>
    </ion-row>
  </ion-grid>
</ion-content>
